window.bookSummaryJSON = "<p>Myke Cole is an expert at ratcheting up suspense and delivering pulse-pounding adventure that leaves audiences breathless. In <i>Shadow Ops: Control Point</i>, the world has seemingly gone mad. People are waking up with magical powers, such as the ability to raise the dead or call forth storms. The only thing staving off a plunge into chaos is the Supernatural Operations Corps, headed by Oscar Britton. But when Oscar exhibits a power of his own, the hunter becomes the hunted.</p>"; 
